import React from 'react';
import { Button, Container, SmallContainer, Header, Image, H1, P, Br, ParallaxBackground } from '../components'
import { Link } from 'react-router-dom'

import bgimg from '../assets/bgimg.jpg'
import bgimg2 from '../assets/bgimg2.jpg'
import ironMan from '../assets/ironMan.jpg'


class Home extends React.Component {
	render() {
		return(
			<ParallaxBackground bgimg={ironMan}>
			<Container>
				<div bgimg={bgimg}>					
					<Header width='420'>
						<H1 big>Phase 1</H1>
						<Br></Br>
						<br></br>
						<P big>I am Iron Man.</P>
					</Header>
				</div>
				<SmallContainer width='800px'>
				<ParallaxBackground bgimg={bgimg}></ParallaxBackground>	
				</SmallContainer>						


			</Container>
			</ParallaxBackground>
		);
	}

}

export default Home;
